import React, { useState, useEffect } from 'react';
import './ExamResult.css';

const ExamResult = () => {
  const [examResults, setExamResults] = useState([]);

  useEffect(() => {
    const fetchExamResults = async () => {
      const RollNo = localStorage.getItem('user');
      try {
        const response = await fetch(`http://localhost:5000/examstudent?RollNo=${RollNo}`);
        const data = await response.json();
        setExamResults(data[data.length-1]);
      } catch (error) {
        console.error('Error fetching exam results:', error);
      }
    };

    fetchExamResults();
  }, []);

  const calculatePercentage = (subjects) => {
    const totalMarks = Object.values(subjects).reduce((total, marks) => total + marks, 0);
    const numberOfSubjects = 6;
    return (totalMarks / (numberOfSubjects * 100)) * 100; // Assuming each subject is out of 100 marks
  };

  const getStatus = (percentage) => {
    return percentage >= 40 ? 'Pass' : 'Fail';
  };

  return (
    <div className="exam-result">
      <h1>Exam Results</h1>
      {examResults.map((result, index) => {
        const percentage = calculatePercentage(result.Subjects);
        const status = getStatus(percentage);
        return (
          <div key={index} className="marksheet">
            <div className="student-info">
              <p><strong>Name:</strong> {result.name}</p>
              <p><strong>Roll No:</strong> {result.RollNo}</p>
              <p><strong>Class:</strong> {result.class}</p>
            </div>
            <table className="marks-table">
              <thead>
                <tr>
                  <th>Subject</th>
                  <th>Marks</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>English</td>
                  <td>{result.Subjects.English}</td>
                </tr>
                <tr>
                  <td>Hindi</td>
                  <td>{result.Subjects.Hindi}</td>
                </tr>
                <tr>
                  <td>Social Science</td>
                  <td>{result.Subjects.Socialscience}</td>
                </tr>
                <tr>
                  <td>Mathematics</td>
                  <td>{result.Subjects.Math}</td>
                </tr>
                <tr>
                  <td>Science</td>
                  <td>{result.Subjects.Science}</td>
                </tr>
                <tr>
                  <td>Subject 6</td>
                  <td>{result.Subjects.subject6}</td>
                </tr>
              </tbody>
            </table>
            <div className="result-info">
              <p><strong>Percentage:</strong> {percentage.toFixed(2)}%</p>
              <p><strong>Status:</strong> {status}</p>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default ExamResult;
